import React, { useState } from 'react';

const App =() =>{
   const [count , newCount] = useState(0);
   const IncNum = () =>{
    newCount(count+1);
   }
   return(
    <>
        <h1>{count}</h1>
        <button onClick={IncNum}>Click Me</button>
    </>
   )
}

export default App;
